    "Never cut off AC to ensure effectiveness of settings.": ["Never cut off AC to ensure effectiveness of settings.", "Trennen Sie nie die Stromverbindung, um die Effektivität der Einstellungen sicherzustellen", "Non interrompere mai l'AC per garantire l'efficacia delle impostazioni.", "Não desligue da tomada para garantir a eficácia das definições.", "Nunca corte la CA para garantizar la eficacia de los ajustes. ", "Ne jamais couper l'alimentation AC pour garantir l'efficacité des réglages.", "Ikke koble fra strømmen, for å ta vare på innstillingene.", "Stäng aldrig av AC för att säkerställa inställningarnas effektivitet ", "Sluk aldrig for strømmen, for at sikre effektiviteten af ​​indstillinger.", "Älä koskaan katkaise vaihtovirtaa varmistaaksesi asetusten tehokkuutta.", "Nikdy neodpojujte napájení pro zajištění účinnosti nastavení.", "Nikdy neodpájajte napájanie pre zabezpečenie účinnosti nastavení.", "Nigdy nie odcinaj zasilania, aby zapewnić skuteczność ustawień.", "A beállítások érvényesítéséhez soha ne szakítsa meg a hálózati kapcsolatot.", "За да се гарантира ефективността на настройките никога не прекъсвайте захранването.", "Ayarların etkililiğini sağlamak için AC gücü asla kesmeyin.", "Sozlamalar kuchga kirishini ta'minlash uchun hech qachon quvvatni uzmang."],
