    "It is going to enter startup navigation , PVR or time shift recording will be stopped, continue?": ["It is going to enter startup navigation , PVR or time shift recording will be stopped, continue?", "Die Start Navigation wird geöffnet, PVR oder Time-Shift werden gestoppt. Fortfahren? ", "Si sta per inoltrare l'avvio della navigazione, la registrazione PVR o Time Shift sarà interrotta, continuare?", "Vai iniciar a navegação, a gravação PVR ou time shift vai parar, deseja continuar?", "Va a entrar en el inicio de navegación, grabación de time shift o PRV se interrumpirá, ¿continuar? ", "Le dispositif va démarrer la navigation, les enregistrements en différé ou PVR seront stoppés, continuer?", "Starter innledende navigering, PVR eller tidsinnstilt opptak vil bli stoppet, fortsette?", "Den kommer att komma in i startnavigering, PVR eller tidsförskjutningsinspelning kommer att stoppas, fortsätta?", "Det kommer til at indtaste start navigation, PVR eller tidsforskudte optagelse vil blive stoppet, fortsætte?", "Syöttää aloitusnavigoinnin, henkilökohtainen video- tai ajansiirtotallennus pysäytetään, haluatko jatkaa?", "Chystáte se vstoupit do navigace spuštění, PVR nebo záznam s časovým posunem (Time Shift) budou zastaveny, chcete pokračovat?", "Chystáte sa vstúpiť do navigácie spustenia, PVR alebo záznam s časovým posunom (Time Shift) budú zastavené, chcete pokračovať?", "Zostanie włączona nawigacja po uruchamianiu, nagrywanie PVR lub Time Shift zostanie zatrzymane, kontynuować?", "Belép az indító navigációba, a PVR vagy a time shift felvétel leáll, folytatja?", "Вход в стартовата навигация. PVR или записването с изместване на времето ще бъдат спрени. Желаете ли да продължите?", "Başlangıç gezintisine girecek, PVR ya da zaman kaydırma kaydı durdurulacak; devam edilsin mi?", "Ishga tushirish navigatsiyasiga kirilmoqda , shaxsiy video yozgich yoki vaqtni surish bilan yozish to'xtatiladi, davom etilsinmi?"],
    "Restoration of factory settings will empty your personal settings and information, PVR or time shift recording will be stopped, continue? ": ["Restoration of factory settings will empty your personal settings and information, PVR or time shift recording will be stopped, continue? ", "Die Wiederherstellung der Werkseinstellungen löscht Ihre persönlichen Einstellungen und Informationen, PVR oder Time-Shift werden beendet. Fortfahren? ", "Il ripristino delle impostazioni di fabbrica svuoterà le informazioni e le impostazioni personali, la registrazione PVR o Time Shift sarà interrotta, continuare?", "O restauro para as definições de fábrica irá eliminar as suas definições e informações pessoais, a gravação PVR ou time shift será parada, deseja continuar? ", "La restauración de los ajustes de fábrica vaciará sus ajustes personales y la información, grabación de time shift o PRV se interrumpirá, ¿continuar?", "Une réinitialisation aux réglages d'origine effacera vos informations et réglages personnels, les enregistrements en différé ou PVR seront stoppés, continuer?", "Gjenoppretting av fabrikkinnstillinger vil slette alle personlige innstillinger og informasjon, PVR eller tidsinnstilt opptak vil bli stoppet, fortsette? ", "Återställning av fabriksinställningar kommer att tömma dina personliga inställningar och information, PVR eller tidsförskjutningsinspelning kommer att stoppas, fortsätta?", "Genoprettelse af fabriksindstillinger vil tømme dine personlige indstillinger og information, PVR eller tidsforskudte optagelse vil blive stoppet, fortsæt?", "Tehdasastusten palauttaminen poistaa henkilökohtaiset astukset ja tiedot, henkilökohtainen video- tai ajansiirtotallennus pysäytetään, haluatko jatkaa?", "Obnovení továrního nastavení vymaže vaše osobní nastavení a informace, PVR nebo záznam s časovým posunem (Time Shift) budou zastaveny, chcete pokračovat? ", "Obnovenie továrenského nastavenia vymaže vaše osobné nastavenia a informácie, PVR alebo záznam s časovým posunom (Time Shift) budú zastavené, chcete pokračovať? ", "Przywrócenie ustawień domyślnych spowoduje usunięcie Twoich informacji i ustawień osobistych, nagrywanie PVR lub Time Shift zostanie zatrzymane, kontynuować?", "A gyári beállítások visszaállításával törli a személyes beállításait és adatait, a PVR vagy a time shift felvétel leáll, folytatja? ", "Възстановяването на фабрично зададените настройки ще изтрие персоналните ви настройки и личната ви информация, а PVR или записването с изместване на времето ще бъдат спрени. Желаете ли да продължите?", "Fabrika ayarlarına geri yükleme, kişisel ayarlarınız ve bilgilerinizi boşaltacak, PVR ya da zaman kaydırma kaydı durdurulacak; devam edilsin mi? ", "Zavod sozlamalarini qayta tiklash natijasida shaxsiy sozlamalaringiz va ma'lumotlaringiz o'chiriladi, shaxsiy video yozgich yoki vaqtni surish bilan yozish to'xtatiladi, davom etilsinmi? "],
