    "Being recording or shifting. Do you want to stop?": ["Being recording or shifting. Do you want to stop?", "Aufnahme oder Verzögerung. Beenden?", "Registrazione o spostamento in corso. Continuare?", "Continuar a gravação ou alterar. Deseja parar?", "Grabando o cambiando. ¿Parar? ", "En cours d'enregistrement ou de différé. Arrêter?", "I opptak eller tidsinnstilling. Ønsker du å stoppe?", "Spelar in eller växla. Ska det stoppas?", "Under optagelse eller skift. Stoppe?", "Tallennus tai vaihto. Haluatko pysäyttää?", "Nahrává se nebo se časově posouvá. Chcete zastavit?", "Nahráva sa alebo sa časovo posúva. Chcete zastaviť?", "Trwa nagrywanie lub Time Shift. Czy chcesz przerwać?", "Felvétel vagy eltolás (shifting) Le akarja állítani?", "В момента се извършва записване или изместване. Желаете ли да прекратите операцията?", "Kaydediliyor ya da kaydırılıyor. Durdurmak istiyor musunuz?", "Yozyapti yoki vaqtni suryapti. To'xtatmoqchimisiz?"],
