    "The white balance will revert back to the factory default settings. Do you want to continue?": ["The white balance will revert back to the factory default settings. Do you want to continue?", "Die Einstellungen des Weißabgleichs werden zurückgesetzt. Wirklich fortfahren?", "Il bilanciamento del bianco ripristinerà le impostazioni predefinite di fabbrica. Desidera continuare?", "O balanço de branco irá reverter para as configurações padrão de fábrica. Quer continuar?", "El balance de blancos volverá a la configuración predeterminada de fábrica. ¿Desea continuar?", "La balance des blancs reviendra aux paramètres d'usine par défaut. Voulez-vous continuer?", "Hvitbalanseinnstillingene tilbakestilles til fabrikkinnstillingene. Vil du fortsette?", "Den vita balansen kommer att gå tillbaka till fabriksinställningarna. Vill du fortsätta?", "Hvidbalancen vender tilbage til fabriksindstillingerne. Vil du fortsætte?", "Valkotasapainon asetukset palautetaan tehdasasetusten mukaisiksi. Haluatko jatkaa?", "Vyvážení bílé se vrátí zpět na výchozí hodnoty od výrobce Chcete pokračovat?", "Vyváženie bielej sa vráti späť na predvolené hodnoty od výrobcu Chcete pokračovať?", "Zostaną przywrócone domyślne ustawienia balansu bieli. Czy chcesz kontynuować?", "A fehéregyensúly visszaáll a gyárilag beállított értékekre. Folytatja?", "Балансът на бялото ще се върне към фабрично зададените настройки. Желаете ли да продължите?", "Beyaz Dengesinin ayarları varsayılan fabrika ayarlarına geri döndürülecek. Devam etmek istiyor musunuz?", "Oq balansi zavod sukut bo'yicha sozlamalariga qaytariladi. Davom etmoqchimisiz?"],
    "Restore 2-point White Balance settings to the factory default values.": ["Restore 2-point White Balance settings to the factory default values.", "Der 2-Punkt Weißabgleich wird auf die Werkseinstellungen zurückgesetzt.", "Ripristina le impostazioni di bilanciamento di bianco 2-point nei valori predefiniti di fabbrica.", "Restaurar configurações de equilíbrio de branco de 2 pontos para os valores padrão de fábrica.", "Restaurar los ajustes del balance de blancos de 2 puntos a los valores predeterminados de fábrica.", "Restaurer les paramètres de balance des blancs 2-points aux valeurs d'usine par défaut.", "Gjenopprette 2-punkt hvitbalanseinnstillinger til fabrikkinnstillinger.", "Återställa 2-punkt vit balans inställningar till fabriksstandardvärdena.", "Gendan 2-punkts hvidbalance til fabriksindstillingerne.", "Palauta 2-point valkotasapainon asetukset tehdasasetusten mukaisiksi.", "Obnoví nastavení 2-bodového vyvážení bílé na výchozí hodnoty od výrobce.", "Obnoví nastavenie 2-bodového vyváženia bielej na predvolené hodnoty od výrobcu.", "Przywróć ustawienia 2-punktowego balansu bieli do wartości domyślnych.", "Állítsa vissza a 2 pontos fehéregyensúly beállításokat a gyárilag alapértelmezett értékekre.", "Възстановяване на настройките за двуточков баланс на бялото до фабричните им стойности.", "2 Nokta Beyaz Dengesinin ayarları varsayılan fabrika ayarları olarak geri yüklenecek.", "2 darajali oq balansi sozlamalarini zavod sukut bo'yicha qiymatlariga qayta tiklang."],
