    "Slightly adjust the brightness of the red, green, or blue lights and optimize the White Balance.": ["Slightly adjust the brightness of the red, green, or blue lights and optimize the White Balance.", "Konfigurieren Sie etwas die Helligkeit von rotem, grünen oder blauem Licht und optimieren Sie den Weißabgleich.", "Regola leggermente la luminosità delle luci rosse, verdi o blu e ottimizza il Bilanciamento di bianco.", "Ajustar ligeiramente o brilho das luzes vermelha, verde ou azul e optimizar o balanço do branco.", "Ajustar ligeramente el brillo de las luces rojas, verdes o azules y optimizar el balance de blancos.", "Ajustez légèrement la luminosité des lumières rouges, vertes ou bleues et optimisez la balance des blancs.", "Juster lysstyrken litt på røde, grønne eller blå lys, og optimaliser hvitbalansen.", "Justera ljusstyrkan lite på de röda, gröna eller blåa ljusen och optimera den vita balansen.", "Justere lysstyrken let på det røde, grønne eller blå lys og optimer hvidbalancen.", "Hienosäädä punaisen, vihreän tai sinisen valon kirkkautta ja optimoi valkotasapaino.", "Mírně upraví jas červeného, zeleného nebo modrého světla a optimalizuje vyvážení bílé.", "Mierne upraví jas červeného, zeleného alebo modrého svetla a optimalizuje vyváženie bielej.", "Delikatnie dostosuj jasność barwy czerwonej, zielonej lub niebieskiej i zoptymalizuj balans bieli.", "Finoman módosítsa a vörös, zöld és kék fények erejét, és optimalizálja a fehéregyensúlyt.", "Леко регулиране на яркостта на червените, зелените или сините светлини и оптимизиране на баланса на бялото.", "Kırmızı, yeşil ya da mavi ışıkların parlaklığını hafifçe ayarlayın ve Beyaz Dengesini en iyi şekle getirin.", "Qizil, yashil yoki ko'k yorug'liklar yorqinligini biroz sozlang va oq balansini optimallang."],
    "Turn 10-point White Balance On or Off.": ["Turn 10-point White Balance On or Off.", "10-Punkt Weißabgleich ein- oder ausschalten.", "Attiva o disattiva il Bilanciamento di bianco 10-point.", "No 10 pontos do balanço de brancos ou desligado.", "Activar o desactivar el balance de blancos de 10 puntos.", "Désactivez ou activez la balance des blancs 10-points.", "Slå 10-punkts hvitbalanse på eller av.", "Sätta på eller av 10-punkt vit balans.", "Tænd eller sluk 10-punkts hvidbalance.", "Aseta 10-Point valkotasapaino Päälle tai Pois.", "Zapne nebo vypne 10 bodové vyvážení bílé.", "Zapne alebo vypne 10 bodové vyváženia bielej.", "Włącz lub wyłącz 10-punktowy balans bieli.", "Kapcsolja be vagy ki a 10 pontos fehéregyensúlyt.", "Включване или изключване на десет точковия баланс на бялото.", "10 Nokta Beyaz Dengesini Açın ya da Kapatın.", "10 darajali oq balansini yoqing yoki o'chiring."],
