    "Reduce seeing afterimages that are left on the screen when viewing fast-moving objects.": ["Reduce seeing afterimages that are left on the screen when viewing fast-moving objects.", "Reduzierung von Nachbildern, die bei der Wiedergabe von schnell bewegten Objekten entstehen.", "Riduce la visione delle immagini residue che sono lasciate sullo schermo durante la visualizzazione di oggetti in rapido movimento.", "Reduzir a velocidade de passagem de imagem depois de ver imagens que são deixadas no ecrã.", "Reducir la vista de las imágenes reflejadas que quedan en la pantalla durante la visualización de objetos en movimiento rápido.", "Réduisez les images consécutives qui restent sur l'écran lors de l'affichage d’objets en mouvement rapide.", "Reduser effekten av etterbilder som henger igjen på skjermen objekter i rask bevegelse vises.", "Reducera att se efterbilder som är kvar på skärmen när du tittar på snabbt rörliga objekt.", "Reducer det skærmslør der er tilbage på skærmen, når du ser ting bevæge sig hurtigt", "Vähentää jälkikuvien näkymistä, joita on jäljellä nopeasti liikkuvien objektien aikana.", "Snižuje viditelnost paobrazů, které jsou ponechány na obrazovce při sledování rychle se pohybujících objektů.", "Znižuje viditeľnosť paobrazov, ktoré sú ponechané na obrazovke pri sledovaní rýchlo sa pohybujúcich objektov.", "Ograniczanie powidoków pozostających na ekranie w przypadku wyświetlania szybko przemieszczających się obiektów.", "Csökkentse a gyorsan mozgó tárgyak nézésekor a képernyőn maradó utóképek mennyiségét.", "Намаляване на остатъчните образи на екрана, които се получават при гледане на бързо-движещи се обекти.", "Hızlı hareket eden nesneleri görüntülerken ekranda görüntü sonrası kalanları azaltır. ", "Ekranda tez harakatlanuvchi predmetlarni ko'rayotganda, ekranda qoldiq tasvir qolib ketishi holatlarini kamaytiring."],
    "Improve how clear the picture appears by reducing noise.": ["Improve how clear the picture appears by reducing noise.", "Verbesserung der Bildschärfe durch Reduzierung von Störungen.", "Migliora la chiarezza dell'immagine riducendo il rumore.", "Melhorar a forma como limpar a imagem aparece ao reduzir o ruído.", "Mejorar la claridad de la imagen al reducir el ruido.", "Améliorez la clarté de l'image qui apparaît en réduisant le bruit.", "Forbedre hvor klart bildet vises ved støyreduksjon.", "Förbättra hur tydlig bilden visas genom att minska oljudet.", "Forbedrer hvor klart billedet vises ved at reducere støj.", "Selkeyttää kuvaa vähentämällä kohinaa.", "Zlepšuje zobrazení jasného obrazu snížením šumu.", "Zlepšuje zobrazenie jasného obrazu znížením šumu.", "Sprawdź czystość obrazu dzięki funkcji redukcji szumów.", "Zajcsökkentéssel növelje a kép tisztaságát.", "Подобряване на яснотата на картината чрез намаляване на шума.", "Gürültüyü azaltarak görüntünün temizlik oranını iyileştirin.", "Shovqinni kamaytirgan holda tasvir aniqligini yaxshilang."],
    "Adjust the sharpness of the picture to reduce horizontal lines from appearing on the TV screen. ": ["Adjust the sharpness of the picture to reduce horizontal lines from appearing on the TV screen. ", "Einstellung der Bildschärfe, um die Anzahl horizontaler Linien auf dem TV-Bildschirm zu reduzieren.", "Regola la nitidezza dell'immagine per ridurre le linee orizzontali dalla comparsa sullo schermo TV.", "Ajustar a nitidez da imagem para reduzir as linhas horizontais que aparecem no ecrã da TV.", "Ajustar la nitidez de la imagen para reducir las líneas horizontales que aparecen en la pantalla del televisor. ", "Ajustez la netteté de l'image pour limiter l’apparition des lignes horizontales sur l'écran du téléviseur. ", "Juster skarpheten av bildet for å redusere horisontale linjer på TV-skjermen. ", "Justera skärpan i bilden för att minska horisontella linjer från att visas på TV-skärmen.", "Juster skarpheden på billedet for at reducere vandrette linjer der kan ses på TV-skærmen.", "Säätää kuvan terävyyttä vähentällä vaakatasossa olevien viivojen esiintymistä ruudulla.", "Nastaví ostrost obrazu pro snížení horizontálních řádků objevujících se na televizní obrazovce. ", "Nastaví ostrosť obrazu pre zníženie horizontálnych riadkov objavujúcich sa na televíznej obrazovke. ", "Dostosuj ostrość obrazu, aby ograniczyć poziome linie pojawiające się na ekranie TV.", "Állítsa be a kép élességét, hogy korlátozza a vízszintes vonalak megjelenését a TV képernyőn. ", "Регулиране на остротата на изображението с цел ограничаване на хоризонталните линии върху екрана на телевизора.", "TV ekranında yatay çizgilerin görünmesi durumunu azaltmak için görüntünün keskinliğini ayarlayın. ", "Televizor ekranida gorizontal chiziqlar paydo bo'lishini kamaytirish uchun tasvir ravshanligini sozlang. "],
    "The component will revert back to the factory default settings. Do you want to continue?": ["The component will revert back to the factory default settings. Do you want to continue?", "Die Option wird auf die Werkseinstellungen zurückgesetzt. Wirklich fortfahren?", "Il componente ripristinerà le impostazioni predefinite di fabbrica. Desidera continuare?", "O componente irá reverter para as configurações padrão de fábrica. Quer continuar?", "El componente volverá a la configuración predeterminada de fábrica. ¿Desea continuar?", "Le composant reviendra aux paramètres d'usine par défaut. Voulez-vous continuer?", "Komponenten vil tilbakestilles til fabrikkinnstillingene. Vil du fortsette?", "Komponenten kommer att gå tillbaka till fabriksinställningarna. Vill du fortsätta?", "Komponenten vil vende tilbage til fabriksindstillingerne. Vil du fortsætte?", "Osa palautuu tehdasasetuksiin, haluatko jatkaa?", "Nastavení komponentů se vrátí zpět na výchozí hodnoty od výrobce Chcete pokračovat?", "Nastavenie komponentov sa vráti späť na predvolené hodnoty od výrobcu Chcete pokračovať?", "Zostaną przywrócone domyślne ustawienia elementu. Czy chcesz kontynuować?", "Az elem visszaáll a gyárilag beállított értékekre. Folytatja?", "Компонентът ще се върне към фабрично зададените настройки. Желаете ли да продължите?", "Bu bileşenin ayarları varsayılan fabrika ayarlarına geri döndürülecek. Devam etmek istiyor musunuz?", "Bu komponent zavod sukut bo'yicha sozlamalariga qaytariladi. Davom etmoqchimisiz?"],
    "Restore the Phase setting to the factory default value.": ["Restore the Phase setting to the factory default value.", "Die Phaseneinstellungen werden auf die Werkseinstellungen zurückgesetzt.", "Ripristina l'impostazione Phase nel valore predefinito di fabbrica.", "Restaurar a configuração para os valores padrão de fábrica.", "Restaurar la configuración de la fase al valor predeterminado de fábrica.", "Restaurer les paramètres de phase aux valeurs d'usine par défaut.", "Gjenopprette faseinnstillingene til fabrikkinnstillinger.", "Återställ Fasinställningarna till fabriksstandardvärdena.", "Gendan fase indstillingen til fabriksindstillingen.", "Palauttaa Phase-asetukset tehdasasetusten mukaisiksi.", "Obnovení fáze nastavení na výchozí hodnoty.", "Obnovenie fázy nastavenia na predvolené hodnoty.", "Przywróć ustawienie fazy do domyślnej wartości.", "Állítsa vissza a Szakasz beállításokaz a gyárilag beállított alapértékekre.", "Връщане на настройките за фаза към фабрично зададените стойности.", "Fazın ayarları varsayılan fabrika ayarları olarak geri yüklenecek.", "Faza sozlamasini zavod sukut bo'yicha qiymatlariga qayta tiklang."],
