    "Restore all the picture settings in the current picture mode to the factory default values.": ["Restore all the picture settings in the current picture mode to the factory default values.", "Alle Bildeinstellungen des aktuellen Bildmodus werden auf die Werkseinstellungen zurückgesetzt.", "Ripristina tutte le impostazioni dell'immagine nella modalità di immagine corrente nei valori predefiniti di fabbrica.", "Restaurar todas as configurações de imagem no modo de imagem actual para os valores padrão de fábrica.", "Restaurar todos los ajustes de imagen en el modo de imagen actual a los valores predeterminados de fábrica.", "Restaurer tous les paramètres d'image configurés dans le mode d'image actuel aux valeurs d'usine par défaut.", "Gjenopprette alle bildeinnstillingene i gjeldende bildemodus til standardverdier.", "Återställ alla bildinställningar i det aktuella bildläget till fabriksinställningarna.", "Gendan alle billed-indstillingerne i den aktuelle billedtilstand til fabriksindstillingerne.", "Palauttaa kaikki kuva-asetukset oleusasetusten mukaisiksi.", "Obnoví všechna nastavení obrazu v aktuálním režimu zobrazení na výchozí hodnoty od výrobce.", "Obnoví všetky nastavenia obrazu v aktuálnom režime zobrazenia na predvolené hodnoty od výrobcu.", "Przywróć wszystkie ustawienia obrazu w bieżącym trybie obrazu do wartości domyślnych.", "Az aktuális képmódban állítsa vissza valamennyi képbeállítást a gyárilag beállított értékekre. ", "Възстановяване на всички настройки на картината в текущия й режим до фабрично зададените стойности.", "Geçerli olan görüntü modunun tüm ayarlarını varsayılan fabrika ayarlarına geri döndür.", "Joriy tasvir rejimidagi barcha tasvir sozlamalarini zavod sukut bo'yicha sozlamalariga qaytariladi."],
