    "Change the way audio is sent through the type of device that's connected to your TV Audio Out port. ": ["Change the way audio is sent through the type of device that's connected to your TV Audio Out port. ", "Stellen Sie je nach Gerätetyp, der mit dem TV-Audioausgang verbunden ist, die Art der Audioübertragung ein.", "Cambia il modo in cui l'audio è inviato tramite il tipo di dispositivo connesso alla porta di Uscita Audio TV.", "Mude a maneira como o áudio é enviado através do tipo de dispositivo que está conectado à TV.", "Cambiar la forma en que se envía el audio a través del tipo de dispositivo que esté conectado al puerto de salida de audio de su TV. ", "Modifiez la façon dont le son est envoyé en fonction du type d'appareil connecté au port de sortie audio de votre téléviseur. ", "Endre måten lyden sendes til enheten som er koblet til lydutgangen på TV-apparatet. ", "Ändra sättet som ljudet skickas genom typen av enhet som är ansluten till din TV ljud utport.", "Skift måden hvorpå lyden sendes gennem den type enhed, der er sluttet til dit TV's lydudgang.", "Muuta tapaa, jolla ääni on lähetetty laitteeseen, joka on yhdistetty TV:n äänen ulostuloporttiin.", "Změní způsob přenosu zvuku prostřednictvím typu zařízení, které je připojeno k televizoru přes port Audio výstup. ", "Zmení spôsob prenosu zvuku prostredníctvom typu zariadenia, ktoré je pripojené k televízoru cez port Audio výstup. ", "Zmień sposób wysyłania dźwięku oraz typ urządzenia podłączony do gniazda wyjściowego dźwięku w telewizorze.", "Módosítsa annak módját, ahogyan a hang keresztüljut a TV Audio Out portjához csatlakoztatott eszköztípuson. ", "Промяна на начина, по който аудио сигналът се изпраща през вида устройство, което е свързано с аудио изхода на вашия телевизор.", "TV'nizin Ses Çıkış portuna bağlı olan cihaz türlerinin hangisi kanalıyla sesin gönderileceğini seçin. ", "Televizoringiz audio chiqish uyasiga ulangan qurilma turi orqali audio jo'natiladigan kanalni o'zgartiring. "],
