    "The current audio settings will revert back to the factory default settings. Do you want to continue?": ["The current audio settings will revert back to the factory default settings. Do you want to continue?", "Die aktuellen Audioeinstellungen werden auf die Werkseinstellungen zurückgesetzt. Wirklich fortfahren?", "Le attuali impostazioni audio saranno ripristinate nelle impostazioni predefinite di fabbrica. Desidera continuare?", "As configurações de áudio atuais irão reverter para as configurações padrão de fábrica. Quer continuar?", "Los ajustes de audio actuales volverán a la configuración predeterminada de fábrica. ¿Desea continuar?", "Les paramètres audio actuels reviendront aux paramètres d'usine par défaut. Voulez-vous continuer?", "Gjeldende lydinnstillinger vil tilbakestilles til fabrikkinnstillingene. Vil du fortsette?", "De nuvarande ljudinställningarna kommer att återgå till fabriksinställningarna. Vill du fortsätta?", "De aktuelle lydindstillinger vender tilbage til fabriksindstillingerne. Vil du fortsætte?", "Käytössä olevat ääniasetukset palautetaan tehdasasetuksiksi, haluatko jatkaa?", "Aktuální nastavení zvuku se vrátí zpět na výchozí hodnoty od výrobce. Chcete pokračovat?", "Aktuálne nastavenie zvuku sa vráti späť na predvolené hodnoty od výrobcu. Chcete pokračovať?", "Zostaną przywrócone domyślne ustawienia dźwięku. Czy chcesz kontynuować?", "Az aktuális audio beállítások visszaállnak a gyárilag beállított értékekre. Folytatja?", "Текущите аудио настройки ще се върнат към фабричния си вид. Желаете ли да продължите?", "Geçerli olan ses ayarları varsayılan fabrika ayarlarına geri döndürülecek. Devam etmek istiyor musunuz?", "Joriy audio sozlamalari zavod sukut bo'yicha sozlamalariga qaytariladi. Davom etmoqchimisiz?"],
    "Restore all of the audio settings in current audio mode to the factory default values.": ["Restore all of the audio settings in current audio mode to the factory default values.", "Alle Audioeinstellungen des aktuellen Audiomodus werden auf die Werkseinstellungen zurückgesetzt.", "Ripristina tutte le impostazioni audio nella modalità audio attuale nei valori predefiniti di fabbrica.", "Restaurar todas as configurações de áudio no modo de áudio atual para os valores padrão de fábrica.", "Restaurar todos las configuraciones de audio en el modo de audio actual a los valores predeterminados de fábrica.", "Restaurer tous les paramètres audio du mode audio actuel aux valeurs d'usine par défaut.", "Gjenopprette alle lydinnstillingene i gjeldende lydmodus til standardverdier.", "Återställa alla ljudinställningar i nuvarande ljudläge till fabriksstandardsvärdena. ", "Gendan alle lydindstillinger i den aktuelle lydtilstand til fabriksindstillingerne.", "Palauta kaikki tämänhetkiset ääniasetukset tehdasasetustilaan.", "Obnoví všechna nastavení zvuku v aktuálním režimu zvuku na výchozí hodnoty od výrobce.", "Obnoví všetky nastavenia zvuku v aktuálnom režime zvuku na predvolené hodnoty od výrobcu.", "Przywróć wszystkie ustawienia dźwięku w bieżącym trybie dźwięku do wartości domyślnych.", "Az aktuális audio módban állítsa vissza valamennyi audio beállítást a gyárilag beállított értékekre.", "Възстановяване на всички настройки на звука в текущия аудио режим до фабрично зададените стойности.", "Geçerli olan ses modunun tüm ses ayarlarını varsayılan fabrika ayarlarına geri döndür.", "Joriy audio rejimidagi barcha audio sozlamalarini zavod sukut bo'yicha qiymatlariga qayta tiklang."],
