    "Select if you receive TV channels over the air (antenna) or through a cable set top box as the input will be used during a channel scan.": ["Select if you receive TV channels over the air (antenna) or through a cable set top box as the input will be used during a channel scan.", "Wählen Sie aus, ob Sie TV-Sender kabellos (via Antenne) oder über eine kabelgestützte Set-Top-Box empfangen, da der Eingang während der Sendersuche verwendet wird.", "Seleziona se ricevi canali TV via etere (antenna) o tramite cavo set-top box dato che l'ingresso sarà usato durante la scansione del canale.", "Escolha se prefere recebe os canais de TV através de antena ou através de uma box definida como a entrada a ser utilizado durante a busca de canais.", "Seleccionar si recibe canales de televisión a través del aire (antena) o por medio de un sintonizador de televisión por cable, ya que la entrada se utilizará durante una búsqueda de canales.", "Sélectionnez ce mode si vous recevez des chaînes de télévision par voie hertzienne (antenne) ou par l'intermédiaire d'un décodeur par câble car l'entrée sera utilisée pendant la recherche de chaînes.", "Velg om du mottar TV-kanaler via antenne eller via dekoder. Denne inngangen vil bli brukt under kanalsøk.", "Välj om du mottar TV-kanaler via eterns (antenn) eller via en kabel kanalbox då ingången kommer att användas under en kanalskanning. ", "Vælg dette hvis du modtager TV-kanaler via luften (antenne) eller via en kabel set-top-box, der bruges som input mens du scanner efter kanaler.", "Valitse otatko signaalia vastaan ilmateitse (antenni) vai kaapelin kautta, valittua tapaa käytetään kanavien skannaamiseen.", "Zvolte, zda v případě vstupu v průběhu vyhledání kanálů budete přijímat televizní kanály anténou nebo prostřednictvím kabelového set-top-boxu.", "Zvoľte, či v prípade vstupu v priebehu vyhľadania kanálov budete prijímať TV kanály anténou alebo prostredníctvom káblového set-top-boxu.", "Wybierz sposób odbioru kanałów TV przez antenę lub zestaw do odbioru telewizji kablowej, ponieważ podane wejście będzie używane podczas skanowania kanałów.", "Válassza ki, hogy a TV csatornákat antennán keresztül vagy egy kábeles set top boxon keresztül fogja-e, ugyanis a bemenet a csatornapásztázás során használatos lesz.", "Изберете ако приемате телевизионни канали по въздуха (чрез антена) или чрез кабел декодер, тъй като входът ще бъде използван по време на сканирането на каналите.", "TV kanallarını havadan (anten ile) mı yoksa bir kablo setüstü kutusu aracılığıyla mı alıp almadığınızı seçin. Yapmış olduğunuz seçin kanal taraması sırasında kullanılacak.", "Telekanallarni to'lqin orqali (antenna) yoki kabel televideniesi pristavkasi orqali qabul qilishingizni tanlang, chunki bu kirish signali kanallarni izlash davomida foydalaniladi."],
