    "Using your Netflix app on your Smart phone or tablet, \"wake up\" your TV to launch Netflix. ": ["Using your Netflix app on your Smart phone or tablet, \"wake up\" your TV to launch Netflix. ", "Verwenden Sie die Netflix-App auf Ihrem Smartphone oder Tablet, um Ihren Fernseher \"zu wecken\" und Netflix zu starten.", "Usando l'app Netflix sullo Smartphone o tablet, \"sollecita\" la TV a lanciare Netflix", "Usando o seu aplicativo Netflix no seu telefone ou tablet, \"acordar\" o seu TV para lançar Netflix.", "Use su aplicación de Netflix en su teléfono inteligente o tableta para \"despertar\" su televisor e iniciar Netflix. ", "Grâce à votre application Netflix sur votre Smartphone ou votre tablette vous pouvez «réveiller» votre téléviseur pour lancer Netflix. ", "Ved hjelp av din Netflix-appen på smarttelefonen eller nettbrettet, kan TV-apparatet \"våkne\" for å starte Netflix. ", "Använda din Netflix app på din smarttelefon eller surfplatta, \"väcker\" din TV till att starta Netflix. ", "Ved hjælp af din Netflix app på din smartphone eller tablet, kan du tænde dit tv og starte Netflix.", "Käyttämällä älypuhelimen tai tabletin Netflix sovellusta, voit \"herättää\" vastaanottimesi avaamaan Netflix:n.", "Používání aplikace Netflix na vašem smartphonu nebo tabletu \"probudí\" televizor pro připojení se k Netflix. ", "Používanie aplikácie Netflix na vašom smartfóne alebo tablete \"prebudí\" televízor pre pripojenie sa k Netflix. ", "Za pomocą aplikacji Netflix na smartfonie lub tablecie możesz „wybudzić” telewizor w celu włączenia Netflix.", "Az okostelefonján vagy tabletjén lévő Netflix alkalmazással \"ébressze fel\" a TV-t, hogy elindítsa a Netflix-t. ", "С помощта на приложението Netflix на вашия смартфон или таблет можете да \"събудите\" телевизора си като стартирате Netflix.", "Akıllı telefonunuzda ya da tabletinizde bulunan Netflix uygulamasını kullanarak uyandırır. Netflix'i çalıştırarak TV'nizi \"uyandırın\". ", "Smartfon yoki planshetda Netflix ilovasidan foydalanish, Netflix ilovasini ishga tushirish uchun televizoringiz \"uyg'oting\". "],
    "Open the function, the standby power consumption will be greater than 0.5W": ["Open the function, the standby power consumption will be greater than 0.5W", "Starten Sie die Funktion; der Energieverbrauch im Standby-Modus ist höher als 0,5W", "Apri la funzione, il consumo energetico in standby sarà maggiore di 0.5W", "Abra a função, o consumo de energia em espera será maior do que 0,5 W", "Habilitar la función. El consumo de energía de reserva será mayor que 0,5 W", "Activer la fonction. La consommation d'énergie en mode veille sera supérieure à 0,5 W", "Når funksjonen er aktiv, vil strømforbruket i standby-modus være høyere enn 0,5 W", "Öppna funktionen kommer standby vara större än 0,5 W", "Åbnes funktionen, vil strømforbruget i standby være større end 0,5 W", "Avaamalla toiminnon, valmiustilan käyttämä kulutus nousee yli 0.5W:n.", "Používáním této funkce bude spotřeba energie v pohotovostním režimu vyšší než 0,5 W.", "Používaním tejto funkcie bude spotreba energie v pohotovostnom režime vyššia ako 0,5 W.", "Otwórz funkcję, pobór energii w trybie gotowości nie będzie większy niż 0,5 W.", "Amennyiben a funkció nyitott, a készenléti áramfelhasználás nagyobb lesz, mint 0,5W.", "При използването на тази функция, консумираната енергия в режим на готовност ще бъде по-голяма от 0.5W.", "İşlevi açın. Bekleme sırasındaki enerji tüketimi 0.5W'dan fazladır.", "Funksiyani oching, kutish rejimida quvvat sarfi 0,5 Vt dan katta bo'ladi"],
    "Share video, music or other content from another device on to your TV screen.": ["Share video, music or other content from another device on to your TV screen.", "Videos, Musik und andere Inhalte von einem externen Gerät auf Ihren TV-Bildschirm übertragen.", "Condividi video, musica o altro contenuto da un altro dispositivo sullo schermo TV.", "Compartilhar vídeo, música ou outros conteúdos de outro dispositivo sobre o seu ecrã de TV.", "Compartir videos, música u otros contenidos de otro dispositivo en la pantalla del televisor.", "Partagez des vidéos, de la musique ou tout autre contenu depuis un autre appareil sur votre téléviseur.", "Del video, musikk eller annet innhold fra en annen enhet på til TV-skjermen.", "Dela video, musik eller annat innehåll från annan enhet på din TV-skärm.", "Del video, musik eller andet indhold fra en anden enhed på din TV-skærm.", "Jaa videoita, musiikkia tai muuta sisältöä toisesta laitteesta TV vastaanottimeesi.", "Sdílejte video, hudbu nebo jiný obsah z jiného zařízení na vaší televizní obrazovce.", "Zdieľajte video, hudbu alebo iný obsah z iného zariadenia na vašej televíznej obrazovke.", "Udostępniaj wideo, muzykę lub inne materiały ze swojego urządzenia na ekran telewizora.", "Osszon meg egy másik eszközről származó videót, zenét vagy más tartalmat a TV képernyőn.", "Споделяне на видео, музика или друго съдържание от друго устройство на екрана на вашия телевизор.", "Başka bir cihazda bulunan videoları, müzikleri ya da diğer içerikleri TV'nizin ekranına gönderin.", "Boshqa qurilmadagi video, musiqa yoki boshqa kontentlarni televizor ekraniga bo'lishing."],
    "Choose a name for your TV. The name will be shown to devices that are available for sharing data.": ["Choose a name for your TV. The name will be shown to devices that are available for sharing data.", "Wählen Sie einen Namen für Ihren Fernseher. Der Name ist für Geräte sichtbar, die für die Freigabe von Daten verfügbar sind.", "Scegli un nome per la TV. Il nome sarà mostrato a dispositivi che sono disponibili per condividere dati.", "Escolha um nome para a sua TV. O nome será mostrado para os dispositivos que estão disponíveis para compartilhamento de dados.", "Elegir un nombre para su TV. El nombre se mostrará a los dispositivos que estén disponibles para el intercambio de datos.", "Choisissez un nom pour votre téléviseur. Le nom sera affiché sur les dispositifs disponibles pour le partage de données.", "Velg et navn på TV-apparatet. Navnet vil bli vist på enheter som er tilgjengelige for deling av data.", "Välj ett namn för din TV. Namnet kommer att visas för de enheter som är tillgängliga för att dela data.", "Vælg et navn til dit tv. Navnet vil blive vist på enheder, der er til rådighed for deling af data.", "Valitse TV vastaanottimellesi nimi. Nimi näytetään laitteille, jotka ovat saatavilla tiedon jakoon.", "Zvolte název pro váš televizor. Název se zobrazí na zařízeních, která jsou k dispozici pro sdílení dat.", "Zvoľte názov pre váš televízor. Názov sa zobrazí na zariadeniach, ktoré sú k dispozícii pre zdieľanie dát.", "Wybierz nazwę dla Twojego telewizora. Nazwa będzie wyświetlana na liście urządzeń do udostępniania danych.", "Válasszon nevet a TV-jének. A név megjelenik azokon az eszközökön, amelyek készek adatokat megosztani. ", "Изберете име на вашия телевизор. То ще бъде показвано на устройствата, които са достъпни за обмен на данни.", "TV'nize bir ad seçin TV'nizin adı, veri paylaşımı için uygun olan cihazlara gösterilecektir.", "Televizoringiz uchun nom tanlang. Ushbu nom ma'lumotlar bo'lishish mumkin bo'lgan qurilmalarga ko'rinadi."],
