    "Restore Parental Control back to the factory default setting.": ["Restore Parental Control back to the factory default setting.", "Die Jugendschutzeinstellungen werden zurückgesetzt.", "Ripristina il Controllo genitori nelle impostazioni predefinite di fabbrica.", "Restaurar o controlo Parental para as configurações padrão de fábrica.", "Restaurar la configuración del control parental al valor predeterminado de fábrica.", "Restaurer le contrôle parental aux paramètres d'usine par défaut.", "Gjenopprette foreldrekontrollen til fabrikkinnstillingene.", "Återställa barnspärr till fabriksinställningarna. ", "Gendan Forældrekontrol tilbage til standardindstillingen.", "Palauttaa Lapsilukon asetukset tehtaan oletusasetuksiksi.", "Obnoví Rodičovskou kontrolu zpět na výchozí hodnoty od výrobce.", "Obnoví Rodičovskú kontrolu späť na predvolené hodnoty od výrobcu.", "Przywróć domyślne ustawienia kontroli rodzicielskiej.", "Állítsa vissza a Szülői felügyelet funkciót a gyárilag beállított értékekre.", "Връщане на функцията за родителски контрол към фабрично зададените настройки.", "Ebeveyn Denetiminin ayarlarını varsayılan fabrika ayarlarına geri döndür.", "Ota-onalar nazorati funksiyasini zavod sukut bo'yicha sozlamalariga qaytaring."],
