    "If you do not accept the agreement, internet based functions and services will not be available.": ["If you do not accept the agreement, internet based functions and services will not be available.", "Falls Sie diese Erklärung nicht akzeptieren, sind Online-Funktionen und Online-Dienste nicht verfügbar.", "Se non si accetta la dichiarazione, le funzioni e i servizi basati su internet non saranno disponibili.", "Se não aceitar o acordo, as funções e serviços que dependem da internet não estarão disponíveis.", "Si no acepta el acuerdo, las funciones y los servicios basados ​​en Internet no estarán disponibles.", "Si vous n'acceptez pas la déclaration, les fonctions et services liés à internet ne seront pas disponibles", "Hvis du ikke godtar avtalen, vil nettbaserte funksjoner og tjenester ikke være tilgjengelig.", "Om du inte accepterar avtalet, kommer internetbaserade funktioner och tjänster inte att vara tillgängliga.", "Hvis du ikke accepterer aftalen, vil internet-baserede funktioner og tjenester ikke være tilgængelige.", "Jos et hyväksy sopimusta, internet-pohjaiset toiminnot ja palvelut eivät ole käytettävissä.", "Pokud nebudete souhlasit s dohodou, funkce a služby založené na internetu nebudou dostupné.", "Ak nebudete súhlasiť s dohodou, funkcie a služby založené na internete nebudú dostupné.", "Jeśli nie akceptujesz umowy, funkcje i usługi internetowe nie będą dostępne.", "Amennyiben nem fogadja el a megállapodást, az internet alapú szolgáltatások és funkciók nem lesznek elérhetőek.", "В случай че не приемете споразумението, функциите и услугите, базирани в Интернет няма да бъдат достъпни.", "Sözleşmeyi kabul etmezseniz, Internet tabanlı işlevler ve hizmetler kullanılamayacaktır.", "Agar kelishuv shartlarini qabul qilmasangiz, internet asosida ishlovchi funksiya va xizmatlardan foydalanib bo'lmaydi."],
    "Join in user improvement plan": ["Join in user improvement plan", "Nehmen Sie an unserem Programm der Nutzeroptimierung teil", "Registrati al piano di miglioramento dell'utente", "Adira ao programa de melhoria da experiência do utilizador", "Ingrese en el plan de mejoramiento de usuario", "Rejoindre le plan d'optimisation utilisateur", "Bli med i brukerforbedringsplan", "Gå med i användarförbättringsplanen", "Deltag i bruger-forbedringsplanen", "Liity käyttäjän kehittämissuunnitelma", "Připojte se k plánu pro uživatelské zlepšení", "Pripojte sa k plánu pre užívateľské zlepšenie", "Przyłącz się do planu udoskonalania przez użytkowników", "Csatlakozzon a felhasználói fejlesztés tervhez", "Присъединете се към потребителски план за подобрение.", "Kullanıcı iyileştirme planına katılın", "Foydalanuvchi tajribasini oshirish loyihasida qatnashing"],
    "Skip network setup": ["Skip network setup", "Netzwerkeinstellungen überspringen", "Saltare l'impostazione di rete", "Saltar a configuração da rede", "Saltar configuración de red", "Passer les réglages réseau", "Hopp over nettverksoppsett", "Hoppa över nätverksinställning", "Spring netværksopsætning over", "Ohita verkon asetukset", "Přeskočit nastavení sítě", "Preskočiť nastavenia siete", "Pomiń ustawienia sieci", "A hálózati beállítások kihagyása", "Прескачане на настройката на мрежата", "Ağ ayarını atla", "Tarmoqni sozlashni o'tkazib yuborish"],
    "If you skip network setup, certain internet based functions and services will be unavailable. Sure to continue?": ["If you skip network setup, certain internet based functions and services will be unavailable. Sure to continue?", "Falls Sie die Netzwerkeinstellungen überspringen, werden bestimmte Online-Funktionen und Online-Dienste nicht verfügbar sein. Wirklich fortfahren?", "Se si salta l'impostazione di rete, alcuni servizi e funzioni basati su internet non saranno disponibili. Sei sicuro di voler continuare?", "Se saltar a configuração da rede, algumas das funções e serviços que dependem da internet não estarão disponíveis. Tem a certeza que quer continuar?", "Si omite la configuración de red, ciertas funciones y servicios basados ​​en Internet no estarán disponibles. ¿Desea continuar? ", "Si vous passez les réglages réseau, certains services et fonctions liés à internet ne seront pas disponibles. Continuer?", "Hvis du hopper over nettverksoppsettet vil enkelte nettbaserte funksjoner og tjenester være utilgjengelige. Er du sikker på at du vil fortsette?", "Om du hoppar över nätverksinställningen, kommer vissa internetbaserade funktioner och tjänster inte att vara tillgängliga. Är du säker på att du vill fortsätta?", "Hvis du springer netværksopsætning over vil visse internetbaserede funktioner og tjenester være utilgængelige. Er du sikker på at du vil fortsætte?", "Jos ohitat verkkoasetukset, tietyt internet-pohjaiset toiminnot ja palvelut eivät ole käytettävissä. Haluatko jatkaa?", "Pokud přeskočíte nastavení sítě, některé funkce a služby založené na internetu nebudou dostupné. Chcete pokračovat?", "Ak preskočíte nastavenie siete, niektoré funkcie a služby založené na internete nebudú dostupné. Chcete pokračovať?", "Jeśli pominiesz ustawienia sieci, określone funkcje i usługi oparte na sieci Internet będą niedostępne. Czy chcesz kontynuować?", "Amennyiben kihagyja a hálózati beállításokat, bizonyos internet alapú funkciók és szolgáltatások nem lesznek elérhetők. Biztosan folytatja?", "Ако прескочите настройката на мрежата, определени функции и услуги, базирани в Интернет няма да бъдат достъпни. Сигурни ли сте, че желаете да продължите?", "Ağ ayarını atlarsanız, bazı Internet tabanlı işlevler ve hizmetler kullanılamayacaktır. Devam etmeye emin misiniz?", "Agar tarmoqni sozlashni o'tkazib yuborsangiz, internet asosida ishlovchi funksiya va xizmatlardan foydalanib bo'lmaydi. Davom etmoqchi ekaningizga ishonchingiz komilmi?"],
