    "Search has yet to be started,is it necessary to skip this step?": ["Search has yet to be started,is it necessary to skip this step?", "Suche muss noch gestartet werde. Ist es notwendig, diesen Schritt zu überspringen? ", "La ricerca è già iniziata, è necessario saltare questa fase?", "A procura ainda não foi iniciada, é necessário ignorar este passo?", "La búsqueda aún no se ha iniciado, ¿es necesario saltar este paso? ", "La recherche n'a pas encore démarré, est-il nécessaire de passer cette étape?", "Søket er ennå ikke i gang, vil du hoppe over dette trinnet?", "Sökningen har ännu inte börjat, är det nödvändigt att hoppa över detta steg?", "Søgning endnu ikke startet, er det nødvendigt at springe dette skridt over?", "Hakua ei ole aloitettu, haluatko hypätä tämän osion yli?", "Vyhledávání se jen začalo, je nutné, abyste tento krok přeskočili?", "Vyhľadávanie sa len začalo, je nutné, aby ste tento krok preskočili?", "Należy uruchomić wyszukiwanie, czy konieczne jest pominięcie tego kroku?", "A keresés még nem kezdődött el, ki kell hagynia ezt a lépést?", "Търсенето все още не е започнало. Необходимо ли е да пропуснете тази стъпка?", "Arama başlatılmamış; bu adımı atlamak gerekli mi?", "Izlash hali boshlangani yo'q, bu qadamni o'tkazib yuborish zarurmi?"],
    "More internet-based services and contents will be served after network settings are finished successfully.": ["More internet-based services and contents will be served after network settings are finished successfully.", "Weitere Internet-basierte Dienste und Inhalte werden angeboten, nachdem die Netzwerkeinstellungen erfolgreich beendet wurden. ", "Saranno messi a disposizione più servizi e contenuti basati su internet dopo che le impostazioni di rete sono state completate con successo.", "Serão oferecidos mais serviços e conteúdos baseados na internet após concluir a configuração das definições de rede com sucesso.", "Más servicios basados ​​en Internet y los contenidos que se proporcionan después de la configuración de red se terminan con éxito. ", "Plus de contenus et services liés à internet seront proposés une fois les réglages de réseau effectués avec succès.", "Flere nettjenester og innhold vil bli tilgjengelig etter at nettverksinnstillingene er konfigurert.", "Fler internetbaserade tjänster och innehåll kommer att serveras efter att nätverksinställningarna har avslutats. ", "Flere internet-baserede tjenester og indhold vil blive serveret efter netværksindstillingerne er færdig med succes.", "Lisää internet-perusteisia palveluja ja sisältöä tullaan tarjoamaan, kun verkonasetukset ovat valmiit.", "Další internetové služby a obsah bude dostupný po úspěšném dokončení nastavení sítě.", "Ďalšie internetové služby a obsah bude dostupný po úspešnom dokončení nastavenia siete.", "Więcej usług i materiałów z Internetu będzie dostępnych po pomyślnym ukończeniu wprowadzania ustawień sieciowych.", "A hálózati beállítások sikeres befejezését követően több internet alapú szolgáltatás és tartalom lesz elérhető.", "След като мрежовите настройки бъдат завършени успешно, ще имате достъп до повече Интернет-базирани услуги и съдържание.", "Ağ ayarları başarıyla tamamlandığında daha fazla Internet tabanlı hizmet ve içerik sunulacaktır.", "Agar tarmoqni sozlash amalga oshirilganidan so'ng, internet asosida ishlovchi yana ko'pgina xizmatlar va kontentlardan foydalanish mumkin."],
