    "In Home Mode, your TV will automatically adjust the brightness of your screen based on the ambient light in the room.": ["In Home Mode, your TV will automatically adjust the brightness of your screen based on the ambient light in the room.", "Im Home-Modus stellt der Fernseher die Bildschirmhelligkeit automatisch je nach Umgebungsbeleuchtung ein.", "In Modalità Home, la TV regolerà automaticamente la luminosità dello schermo in base alla luce ambiente nella stanza.", "No Modo Casa, o seu televisor ajusta automaticamente ao brilho do ecrã com base na luz ambiente na sala.", "En el Modo del Hogar, el televisor ajustará automáticamente el brillo de la pantalla en función de la luz ambiental en la sala.", "En Mode Accueil, votre téléviseur ajuste automatiquement la luminosité de votre écran en fonction de la lumière ambiante de la pièce.", "I hjemmemodus vil TV-apparatet automatisk justere lysstyrken på skjermen, basert på lyset i rommet.", "I Hemläge kommer din TV att automatiskt justera din skärms ljusstyrka baserat på det omgivande ljuset i rummet.", "I hjemme-tilstand vil tv'et automatisk justere lysstyrken på skærmen i forhold til det omgivende lys i rummet.", "Kotitilassa TV vastaanottimesi säätää kirkkauden automaattisesti sen mukaan kuin valoa on huoneessa", "V Domácím režimu váš televizor automaticky upraví jas obrazovky na základě okolního světla v místnosti.", "V Domácom režime váš televízor automaticky upraví jas obrazovky na základe okolitého svetla v miestnosti.", "W trybie domowym telewizor automatycznie dostosuje jasność ekranu do ilości światła w pomieszczeniu.", "Home módban a TV atomatikusan beállítja a képernyő fényerejét, a helyiség világosságától függően.", "В домашен режим телевизорът автоматично регулира яркостта на екрана в зависимост от околната светлина в помещението.", "Ev Modundayken TV'niz, odanızdaki ortam ışığına göre ekranınızın parlaklık düzeyini otomatik olarak ayarlayacaktır.", "Uy rejimida televizor xonadagi yorug'likka qarab ekran yorqinligini avtomatik tarzda sozlaydi."],
    "Select Store Mode if the TV will be on display in a retail setting. The TV will no longer be in Energy Star mode.": ["Select Store Mode if the TV will be on display in a retail setting. The TV will no longer be in Energy Star mode.", "Wählen Sie den Retail-Modus, falls der Fernseher in einem Geschäft verwendet wird. Der Energiesparmodus wird dann deaktiviert.", "Seleziona Modalità Store se la TV sarà in mostra in un ambiente di vendita al dettaglio. La TV non sarà più in modalità Energy Star. ", "Selecione o modo loja se a TV vai estar em exibição num ambiente de loja. A TV não estará mais no modo de economia de energia.", "Seleccione El Modo de Comercial si la TV estará en exposición en un sitio comercial. La TV ya no estará en modo Energy Star.", "Sélectionnez Mode Magasin si le téléviseur est destiné à être exposé dans un environnement commercial. Le téléviseur ne sera plus en mode Energy Star.", "Velg Retail-modus hvis TV-apparatet står til utstilling i butikk. TV-apparatet vil ikke lenger være i Energy Star-modus.", "Välj Butiksläge om TV:n kommer att visas i en detaljhandelinställning. TV:n kommer inte längre att vara i Energi Stjärnläge.", "Vælg butiks-tilstand hvis tv'et skal udstilles i en detailbutik. Tv'et vil ikke længere være i Energy Star-tilstand.", "Valitse myymälätila, jos TV on esillä myymälässä. TV ei tällöin enää ole Energy Star -tilassa.", "Zvolte Režim obchodu v případě, že TV bude umístěn a vystaven v obchodě. TV následně nebude v režimu Energy Star.", "Zvoľte Režim obchodu v prípade, že TV bude umiestnený a vystavený v obchode. TV následne nebude v režime Energy Star.", "Wybierz tryb sklepowy, jeśli TV będzie wystawiony jako ekspozycja sprzedażowa. TV nie będzie dłużej używał trybu oszczędzania Energy Star.", "Válassza a Bolt módot, amennyiben a TV-t kiskereskedelmi egységben állítja ki. A TV kilép az Energy Star módból.", "Режим магазин се избира ако телевизорът бъде изложен в търговски условия. При това положение режим Енергийна звезда ще бъде изключен.", "TV'nizi satış yapacağınız bir ortamda kullanacaksanız Mağaza Modu'nu seçin. TV artık Energy Star modunda olmayacak.", "Televizor do'kon peshtaxtasiga ko'zgazma qilib qo'yilgan bo'lsa, do'kon rejimidan foydalaning. Televizor Energy Star rejimida bo'lmaydi."],
