    "Please close down or cancel either of the following tasks as no available resources are served.": ["Please close down or cancel either of the following tasks as no available resources are served.", "Bitte beenden oder brechen Sie die folgenden Aufgaben ab, da keine Ressourcen vorhanden sind.", "Si prega di chiudere o cancellare una delle seguenti attività messe a disposizione senza risorse disponibili", "Feche ou cancele uma das tarefas que se seguem pois não há recursos disponíveis.", "Por favor, cierre o cancele cualquiera de las siguientes tareas ya que no sirven los recursos disponibles. ", "Merci de fermer ou annuler l'une ou l'autre des tâches suivantes du fait qu'aucune ressource disponible n'est proposée.", "Vennligst lukk eller avbryt en av følgende oppgaver, ettersom ingen ressurser er tilgjengelig.", "Vänligen stäng ned eller avbryt någon av följande uppgifter eftersom inga tillgängliga resurser är serverade. ", "Du bedes lukke eller annullere en af ​​følgende opgaver, som er grunden til at der ingen ledige ressourcer er.", "Sulje tai peru jompikumpi seuraavista tehtävistä, koska lähteitä ei ole saatavilla.", "Prosím zavřete nebo zrušte jednu z následujících úkolů nakolik nejsou dostupné žádné zdroje.", "Prosím zavrite alebo zrušte jednu z nasledujúcich úloh nakoľko nie sú dostupné žiadne zdroje.", "Zamknij lub anuluj poniższe zadania, gdyż nie ma dostępnych zasobów.", "Zárja be vagy törölje az alábbi feladatok valamelyikét, ugyanis nincs elérhető forrás.", "Моля затворете или отменете някоя от следните задачи, тъй като няма достатъчно ресурси за тяхното обслужване.", "Kullanılabilir hiçbir kaynak sunulmadığından lütfen aşağıdaki görevlerden herhangi birini kapatın ya da iptal edin.", "Resurslar yo'qligi sababli quyidagi vazifalarni tugating yoki bekor qiling. "],
    "Please close down or cancel either of the following tasks as the period of reservation expires and no available resources are served.": ["Please close down or cancel either of the following tasks as the period of reservation expires and no available resources are served.", "Bitte beenden oder brechen Sie die folgenden Aufgaben ab, da der Reservierungszeitraum abläuft und keine Ressourcen vorhanden sind.", "Si prega di chiudere o cancellare una delle seguenti attività messe a disposizione senza risorse disponibili e con periodo di registrazione scaduto.", "Feche ou cancele uma das tarefas que se seguem pois o período de reserva expirou e não há recursos disponíveis.", "Por favor, cierre o cancele cualquiera de las siguientes tareas ya que el período de reserva expira y no sirven los recursos disponibles. ", "Merci de fermer ou annuler l'une ou l'autre des tâches suivantes du fait que la période de réservation est expirée et qu'aucune ressource disponible n'est proposée.", "Vennligst lukk eller avbryt en av følgende oppgaver, ettersom reservasjonsperioden utgår og ingen ressurser er tilgjengelig.", "Vänligen stäng ned eller avbryt någon av följande uppgifter eftersom reservationsperioden förfaller och inga tillgängliga resurser är serverade. ", "Du bedes lukke eller annullere en af ​​følgende opgaver eftersom reservationsperioden udløber, og der ikke er nogen ledige ressourcer.", "Sulje tai peru jompikumpi seuraavista tehtävistä, koska varausaika menee umpeen eikä lähteitä ole saatavilla.", "Prosím zavřete nebo zrušte jednu z následujících úkolů nakolik, doba rezervace vypršela a nejsou dostupné žádné zdroje.", "Prosím zavrite alebo zrušte jednu z nasledujúcich úloh nakoľko, doba rezervácie vypršala a nie sú dostupné žiadne zdroje.", "Zamknij lub anuluj poniższe zadania, gdyż upłynął zaplanowany okres i nie ma dostępnych zasobów.", "Zárja be vagy törölje az alábbi feladatok valamelyikét, ugyanis az előirányzási idő lejár, és nincs eléthető forrás.", "Моля затворете или отменете някоя от следните задачи, тъй като периода за резервиране изтича и няма достатъчно ресурси за тяхното обслужване.", "Ayırma süresi sona erdiğinden ve kullanılabilir hiçbir kaynak sunulmadığından lütfen aşağıdaki görevlerden herhangi birini kapatın ya da iptal edin.", "Zaxira muddati o'tganligi va resurslar yo'qligi sababli quyidagi vazifalarni tugating yoki bekor qiling. "],
