    "This is the default city, if you delete it, the weather information will not display on the home page. Press OK to confirm deletion. You may set a city as default on the Add a city page.": ["This is the default city, if you delete it, the weather information will not display on the home page. Press OK to confirm deletion. You may set a city as default on the Add a city page.", "Dies ist die Standardeinstellung. Wird die Stadt gelöscht, werden Wetterdaten nicht auf der Homepage angezeigt. Drücken Sie OK zum Löschen. Auf der Seite Stadt hinzufügen können Sie eine Stadt als Standardeinstellung auswählen.", "Questa è la città predefinita, se la cancelli, le informazioni meteo non saranno più disponibili nella homepage. Premere OK per confermare l'eliminazione. È possibile impostare una città predefinita alla pagina Aggiungi una città.", "Esta é a cidade padrão, se a apagar, as informações do tempo não serão exibidas na página inicial. Pressione OK para confirmar a exclusão. Pode definir uma cidade como padrão na página.", "Esta es la ciudad por defecto. Si la elimina, la información meteorológica no se mostrará en la página de inicio. Presione OK para confirmar la eliminación. Una ciudad se puede establecer como predeterminada en la página Añadir una ciudad.", "C'est la ville par défaut. Si vous la supprimez, les informations météorologiques ne s'afficheront pas sur la page d'accueil. Appuyez sur OK pour confirmer la suppression. Vous pouvez configurer une ville par défaut sur la page Ajouter une ville.", "Dette er standardbyen, hvis du sletter den vil værinformasjonen ikke vises på hjemmesiden. Trykk på OK-knappen for å bekrefte slettingen. Du kan angi en by som standard under \"Legg til en by\".", "Detta är standardstaden. Om du ta bort den kommer väderinformationen inte visas på hemsidan. Tryck på OK för att bekräfta borttagningen. Du kan sätta in en stad som standard på Lägg till stad sidan.", "Dette er standardbyen, hvis du sletter den, vises vejr-oplysningerne ikke på hjemmesiden. Tryk på OK for at bekræfte sletningen. Du kan indstille en by som standardby på \"Tilføj en by\"-siden.", "Tämä on oletuskaupunki, jos poistat sen, niin säätietoja ei voida näyttää kotisivulla. Paina OK hyväksyäksesi poiston. Voit lisätä oletuskaupungin Lisää Kaupunki -sivulla.", "Toto je výchozí město, pokud jej odstraníte, na domovské stránce se nebude zobrazovat informace o počasí. Stisknutím tlačítka OK potvrďte vymazání. Můžete nastavit město jako výchozí na stránce Přidat město.", "Toto je predvolený mesto, ak ho odstránite, na domovskej stránke sa nebude zobrazovať informácia o počasí. Stlačením tlačidla OK potvrďte vymazanie. Môžete nastaviť mesto ako predvolené na stránke Pridať mesto.", "Jest to domyślne miasto, jeśli je usuniesz, informacje o pogodzie nie zostaną wyświetlone na stronie głównej. Naciśnij OK, aby potwierdzić usunięcie. Możesz dodać domyślne miasto na stronie Dodaj miasto.", "Ez az alapértelmezett város, ha törli, az időjárással kapcsolatos információ nem jelenik meg a kezdőoldalon. A törlés megerősítéséhez nyomja meg az OK gombot. A város hozzáadása oldalon beállíthat alapértelmezett várost.", "Този град е зададен по подразбиране. В случай че го изтриете, на началната страница няма да бъде показвана информация за времето. Натиснете ОК, за да потвърдите изтриването. Можете да зададете град по подразбиране на страницата за добавяне на град.", "Bu, varsayılan şehirdir. Bunu silerseniz, hava durumu bilgisi ana sayfada görüntülenmeyecek. Silmeyi onaylamak için Tamam'a basın. Bir şehir ekle sayfasından herhangi bir şehri varsaylan olarak atayabilirsiniz.", "Bu sukut bo'yicha shahar, agar uni o'chirsangiz, ob-havo ma'lumoti bosh sahifada ko'rsatilmaydi. O'chirishni tasdiqlash uchun OK'ni bosing. Shahar qo'shish sahifasida sukut bo'yicha shaharni o'rnatishingiz mumkin."],
