    "This will reset all settings to factory default. Do you want to continue?": ["This will reset all settings to factory default. Do you want to continue?", "Dadurch werden alle Einstellungen zurückgesetzt. Wirklich fortfahren?", "Questo ripristinerà tutte le impostazioni di fabbrica predefinite. Desidera continuare?", "Isso irá redefinir todas as configurações para os padrões de fábrica. Quer continuar?", "Esto restablecerá todos los ajustes a los valores de fábrica. ¿Quieres continuar?", "Ceci permet de réinitialiser tous les réglages d'usine par défaut. Voulez-vous continuer?", "Dette vil tilbakestille alle innstillinger til standardinnstillinger. Vil du fortsette?", "Detta kommer att återställa alla inställningar till fabriksstandard. Vill du fortsätta?", "Dette vil nulstille alle indstillinger til fabriksindstillingerne. Vil du fortsætte?", "Tämä nollaa kaikki asetukset tehdasasetuksiksi. Haluatko jatkaa?", "Tím se obnoví všechna nastavení na výchozí hodnoty od výrobce. Chcete pokračovat?", "Tým sa obnovia všetky nastavenia na predvolené hodnoty od výrobcu. Chcete pokračovať?", "Spowoduje to zresetowanie wszystkich ustawień do domyślnych. Czy chcesz kontynuować?", "Az összes beállítást visszaállítja a gyárilag alapértelmezett értékre. Folytatja?", "Това ще върне всички настройки към фабричния им вид. Желаете ли да продължите?", "Bu, tüm ayarları varsayılan fabrika ayarlarına döndürecek. Devam etmek istiyor musunuz?", "Barcha sozlamalar zavod sukut bo'yicha qiymatlariga qaytariladi. Davom etmoqchimisiz?"],
    "This feature is currently unavailable!": ["This feature is currently unavailable!", "Diese Funktion ist momentan nicht verfügbar!", "Questa funzione non è disponibile attualmente!", "Este recurso está disponível de momento!", "Esta característica no está disponible!", "Cette fonction est actuellement indisponible!", "Denne funksjonen er for øyeblikket ikke tilgjengelig!", "Denna funktion är för tillfället otillgängligt!", "Denne funktion er ikke tilgængelig i øjeblikket!", "Tämä toiminto ei juuri nyt ole saatavissa!", "Tato funkce v současné době není k dispozici!", "Táto funkcia v súčasnej dobe nie je k dispozícii!", "Ta funkcja jest aktualnie niedostępna!", "Ez a funkció jelenleg nem elérhető!", "В момента функцията не работи.", "Bu özellik şu an için mevcut değil.", "Ushbu funksiya hozircha mavjud emas!"],
    "Input value is invalid, please try again!": ["Input value is invalid, please try again!", "Eingabewert ist ungültig, bitte erneut versuchen!", "Il valore di input non è valido, si prega di riprovare!", "O valor de entrada é inválido, por favor, tente novamente!", "El valor de entrada no es válido, por favor intente de nuevo!", "La valeur d'entrée ne est pas valide, se il vous plaît essayer de nouveau!", "Angitt verdi er ugyldig, prøv igjen!", "Ingångsvärdet är ogiltigt, vänligen försök igen!", "Den angivne værdi er ugyldig, prøv igen!", "Annettu arvo on virheellinen, yritä uudelleen!", "Vstupní hodnota je neplatná, zkuste to znovu!", "Vstupná hodnota je neplatná, skúste to znova!", "Wprowadzona wartość jest nieprawidłowa, spróbuj ponownie!", "A bevitt érték érvénytelen, próbálja újra!", "Въведената стойност е невалидна, моля опитайте отново.", "Giriş değeri geçersiz, lütfen tekrar deneyin!", "Kiritilgan qiymat noto'g'ri, yana urinib ko'ring!"],
    "Note: Please keep your network connection": ["Note: Please keep your network connection", "Hinweis: Netzwerkverbindung aufrecht erhalten", "Nota: Si prega di mantenere la connessione di rete ", "Nota: Por favor, mantenha a sua conexão de rede", "Nota: Por favor, mantenga su conexión de red", "Remarque: Se il vous plaît continuez votre connexion réseau", "Merk: Sørg for at nettverkstilkoblingen er aktiv", "Observera: Vänligen behåll din nätverksanslutning", "Bemærk: Du skal opretholde din netværksforbindelse", "Huomio: Älä katkaise verkkoyhteyttä.", "Poznámka: Prosím, zachovejte vaše připojení k síti", "Poznámka: Prosím, zachovajte vaše pripojenie k sieti", "Uwaga: Utrzymuj połączenie sieciowe", "Megjegyzés: Tartsa fenn a hálózati csatlakozást", "Забележка: Внимавайте да не прекъснете мрежовата връзка.", "Not: Lütfen ağa bağlı kalmaya devam edin", "Izoh: Tarmoqqa ulanishni saqlab turing."],
    "Error, unable to complete the upgrade!": ["Error, unable to complete the upgrade!", "Error; Aktualisierung konnte nicht durchgeführt werden!", "Errore, impossibile completare l'aggiornamento!", "Erro, incapaz de completar a actualização!", "Error, no pudo completar la actualización!", "Erreur, incapable de terminer la mise à niveau!", "Det oppsto en feil, kunne ikke fullføre oppgraderingen!", "Fel, kan inte fullborda uppgraderingen!", "Fejl, ude af stand til at fuldføre opgraderingen!", "Virhe, päivitystä ei mahdollista saattaa loppuun!", "Chyba, nepodařilo se dokončit aktualizaci!", "Chyba, nepodarilo sa dokončiť aktualizáciu!", "Błąd, nie można zakończyć uaktualniania!", "Hiba, a frissítést nem sikerült befejezni!", "Грешка! Надстройката не може да бъде довършена.", "Hata, yükseltme tamamlanamıyor!", "Xato, yangilashni tugallab bo'lmaydi!"],
