    "The default PIN to enter on your Wi-Fi router is 12345678. The setup process may take up to 2 minutes to complete.": ["The default PIN to enter on your Wi-Fi router is 12345678. The setup process may take up to 2 minutes to complete.", "Die Standard-PIN für die Eingabe an Ihrem Router ist 12345678. Der Setup kann bis zu 2 Minuten dauern.", "Il PIN predefinito da inserire sul router Wi-Fi è 12345678. Il processo di installazione può richiedere fino a 2 minuti.", "O PIN padrão para entrar no seu roter de Wi-Fi é 12345678. O processo de instalação pode levar até dois minutos para ser concluído.", "El PIN predeterminado para entrar en el router Wi-Fi es 12345678. El proceso de instalación puede tardar hasta 2 minutos.", "Le code (PIN) par défaut pour entrer sur votre routeur Wi-Fi est 12345678. Le processus d'installation peut prendre jusqu'à deux minutes pour terminer.", "Standard PIN for å komme inn på Wi-Fi-ruteren er 12345678. Innstillingene kan ta opptil to minutter å aktivere", "Standard PIN för att ange din Wi-Fi router är 12345678. Inställningsprocessen kan ta upp till 2 minuter att fullborda.", "Standard PIN-koden som du skal indtaste i din Wi-Fi-router er 12345678. Opsætningsprocessen kan tage op til 2 minutter.", "Oletus PIN-koodi Wi-Fi reitittimeesi on12345678. Asennus voi kestää 2 minuuttia.", "Výchozí PIN pro vstup na Váš Wi-Fi router je 12345678. Instalační proces může trvat až 2 minuty.", "Predvolený PIN pre vstup na Váš Wi-Fi router je 12345678. Inštalačný proces môže trvať až 2 minúty.", "Domyślny PIN do wprowadzenia na routerze Wi-Fi to 12345678. Ukończenie procesu wprowadzania ustawień może zająć do 2 minut.", "A Wi-Fi routerbe rögzítendő alapértelmezett PIN: 12345678. A telepítési folyamat befejezése 2 percig is eltarthat.", "Фабрично зададеният PIN код на вашия Wi-Fi рутер е 12345678. Процесът на настройване може да отнеме до 2 минути.", "Wi-Fi yönlendiricinize gireceğiniz varsayılan PIN kodu: 12345678 Kurulum işleminin tamamlanması iki dakikayı bulabilir.", "Wi-Fi marshrutlagichda kiritish kerak bo'lgan sukut bo'yicha PIN kod 12345678. Sozlash jarayoni 2 daqiqagacha davom etishi mumkin."],
    "Tap the Wi-Fi protected setup button on your router. It may be called WPS or contain this symbol.": ["Tap the Wi-Fi protected setup button on your router. It may be called WPS or contain this symbol.", "Drücken Sie an Ihrem Router die WPS-Taste. Diese ist mit WPS oder folgendem Symbol gekennzeichnet.", "Premere il tasto di installazione protetta Wi-Fi sul router. Può essere chiamato WPS o contenere questo simbolo.", "Toque no botão de configuração protegida Wi-Fi no seu roter. Pode ser chamado WPS ou conter este símbolo.", "Pulse el botón de configuración protegida Wi-Fi en su router. Se le puede llamar WPS o contiene este símbolo.", "Appuyez sur le bouton de configuration protégée Wi-Fi sur votre routeur. Il peut être appelé WPS ou contient ce symbole.", "Trykk på Wi-Fi Protected Setup-knappen på ruteren. Dette er enten merket WPS eller med dette symbolet.", "Tryck på Wi-Fi skyddat inställningsknappen på routern. Den kan kallas WPS eller innehålla denna symbol.", "Tryk på knappen \"Wi-Fi-Protected Setup\" på routeren. Den kaldes evt. WPS eler genkendes på dette symbol.", "Napsauta Wifi:n suojattua asetuspainiketta reitittimestäsi, siinä voi olla merkintä WPS tai tämä symboli:", "Klepněte na tlačítko Wi-Fi chráněné nastavení (Wi-Fi protected setup) na vašem routeru. Může být nazýváno jako WPS nebo může obsahovat tento symbol.", "Kliknite na tlačidlo Wi-Fi chránené nastavenie (Wi-Fi protected setup) na vašom routeri. Môže byť nazývané ako WPS alebo môže obsahovať tento symbol.", "Użyj przycisku funkcji Wi-Fi Protected Setup na Twoim routerze. Może nazywać się WPS lub zawierać taki symbol.", "Érintse meg a Wi-Fi védett telepítés gombot a routerén. Ennek neve lehet WPS vagy ezt a szimbólumot tartalmazhatja.", "Натиснете бутона за защита на безжичната връзка върху рутера си. Той може да се нарича WPS или да съдържа следния символ:", "Yönlendiricinizin üzerinde bulunan korumalı Wi-Fi kurulum butonuna basın. WPS olara adlandırılabilir ya da şu sembol ile gösterilir:", "Marshrutlagichingizdagi Wi-Fi himoyalangan sozlash tugmasini bosing. U \"WPS\" tugmasi deb atalishi yoki tugmada shu belgi bo'lishi mumkin."],
    "Full menu settings": ["Full menu settings", "Alle Menüeinstellungen", "Impostazioni di menu complete", "Configurações de menu completo", "Todos los ajustes de menú", "Tous les réglages de menu", "Alle menyinnstillinger", "Full menyinställningar", "Komplette menuindstillinger", "Täydet valikkoasetukset", "Nastavení Kompletního menu", "Nastavenie Kompletného menu", "Pełne ustawienia menu", "Teljes menü beállítások", "Пълни настройки на менюто", "Tüm menü ayarları", "To'liq menyu sozlamalari"],
    "Your customized setup information will be erased once you restore the TV back to factory default settings. Do you still want to continue?": ["Your customized setup information will be erased once you restore the TV back to factory default settings. Do you still want to continue?", "Ihre benutzerdef. Einstellungen werden gelöscht, wenn Sie den Fernseher auf die Werkseinstellungen zurücksetzen. Fortfahren?", "Le informazioni di configurazione personalizzata verranno cancellate una volta ripristinata la TV nelle impostazioni predefinite di fabbrica. Desidera ancora continuare?", "As suas informações de configuração personalizada serão apagadas uma vez que restaurou a TV esta volta para ás configurações padrão de fábrica. Deseja continuar?", "Su información de configuración personalizada se borrará una vez que restaura la TV a los ajustes predeterminados de fábrica. ¿Desea continuar?", "Votre information de configuration personnalisée est supprimé une fois restaure le téléviseur aux réglages d'usine par défaut. Voulez-vous continuer?", "Den egendefinerte installasjonsinformasjonen blir slettet når du gjenoppretter TV-apparatet til fabrikkinnstillingene. Vil du fortsette likevel?", "Din anpassade inställningsinformation kommer att raderas så snart du återställer TV:n till fabriksinställningarna. Vill du fortfarande fortsätta?", "Dine brugerdefinerede indstillinger slettes, når du gendanner TV'et til fabriksindstillingerne. Vil du stadig at fortsætte?", "Mukautetut asetukset poistetaan kun TV palautetaan tehdasasetuksiin. Haluatko jatkaa?", "Vaše vlastní informace o nastavení budou vymazány, jakmile restartujete televizor zpět na výchozí hodnoty od výrobce. Chcete přesto pokračovat?", "Vaše vlastné informácie o nastavení budú vymazané, akonáhle reštartujete televízor späť na predvolené hodnoty od výrobcu. Chcete napriek tomu pokračovať?", "Informacje o własnych ustawieniach zostaną usunięte po przywróceniu TV do domyślnych ustawień. Czy nadal chcesz kontynuować?", "A személyre szabott telepítési információ törkődik, ha a TV-t visszaállítja a gyári alapértelmezésekre. Biztosan folytatja?", "Информацията за персонализираните от вас настройки ще бъде изтрита, след като възстановите фабрично зададените настройки на телевизора. Все още ли желаете да продължите?", "TV'nizi varsayılan fabrika ayarlarına geri döndürürseniz kişiselleştirilmiş kurulum bilgileriniz silinir. Yine de devam etmek istiyor musunuz?", "Televizoringizni zavod sukut bo'yicha sozlamalariga qaytargandan so'ng, sizning alohida tanlangan sozlash ma'lumotlaringiz o'chiriladi Baribir davom etmoqchimisiz?"],
